import React from 'react'


const LandingPage = () => {
  const redirect = (path) => {
    window.location = path
  }
  return (
    <div>
      <div>
        <h1>
            This is test web application
        </h1>
      </div>

      <div>
        <button onClick={() => redirect('/login')}>LogIn</button>
        <button>Register</button>
      </div>
        
    </div>
  )
}

export default LandingPage
